import React from 'react';
import './App.css';

const initialState = {
    item: 'Learn about reducers',
    completed: false,
    id: 3892987589,
};

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Redux Todo List</h1>
            </header>
        </div>
    );
}

export default App;
